import React from "react";
import HomePage from "./HomePage"
import {Route, Routes, useNavigate} from "react-router-dom"

function App() {
    const navigate = useNavigate();

    return (
        <div>
            <Routes>
                <Route path="/" element={<HomePage/>}/>
            </Routes>
        </div>
    );
}

export default App;
